  false,\n\t\"url\": null,\n\t\"notes\": \"The project will expand the scope of forest
  restoration treatment monitoring for Collaborative Forest Landscape Restoration
  projects in 3 key ways: 1) augment wildlife monitoring efforts to include a more
  diverse range of species and/or guilds, including several species of conservation
  concern within the SRLCC; 2) expand the monitoring of understory plant response
  to provide a holistic evaluation of treatment impacts on understory plant communities;
  3) add monitoring plots both on non-USFS lands managed by partner agencies, and
  on adjacent untreated lands to serve as a comparison and to allow for the evaluation
  of landscape-scale effects. Our results will provide important data on the effects
  of forest restoration treatments on key plant and animal species in Colorado.\",\n\t\"owner_org\":
